import React from 'react'
import PropTypes from 'prop-types'
import {
  Text, View, StatusBar, Image, ImageBackground,
} from 'react-native'
import Button from '../../components/Button'
import { images } from '../../theme'
import styles from './Style'

const StartPage = ({ navigation }) => (
  <View style={styles.root}>
    <ImageBackground
      source={images.background}
      resizeMode="cover"
      style={{
        alignItems: 'center',
        flex: 1,
      }}
    >
      <StatusBar barStyle="light-content" />
      <View style={styles.content1}>
        <Image style={styles.tinyLogo} source={images.cats} />
        <Text style={styles.title}> Let&#39;s go date!</Text>
      </View>
      <View style={styles.content2}>
        <Button
          style={styles.login}
          variant="outline"
          title="Zaloguj siÄ™"
          color="white"
          onPress={() => {
            navigation.navigate('LoginForm', { from: 'Home' })
          }}
        />
        <Button
          style={styles.signup}
          title="Sign Up"
          color="#FF6C93"
          onPress={() => {
            navigation.navigate('SignUpForm', { from: 'Home' })
          }}
        />
      </View>
    </ImageBackground>
  </View>
)

StartPage.propTypes = {
  navigation: PropTypes.shape({
    navigate: PropTypes.func,
  }),
}

StartPage.defaultProps = {
  navigation: { navigate: () => null },
}

export default StartPage
